sys_variable_value.value:
(function execute(inputs, outputs) {

    const forks = JSON.parse(inputs.response_body);
    for (var i = 0; i < forks.length; i++) {
        if (forks[i].owner.id == inputs.entity_id) {
            outputs.fork_exists = true;
            outputs.fork_id = forks[i].id;
            outputs.fork_name = forks[i].name;
            outputs.ssh_url = forks[i].ssh_url;
            outputs.default_branch = forks[i].default_branch;
            break;
        }
    }

})(inputs, outputs);

